import * as React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Checkbox from '@material-ui/core/Checkbox';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
    form: {
        backgroundColor: 'white',
        borderRadius: '10px',
        margin: theme.spacing(1),
        width: '50ch'
    },
    searchBar: {
        paddingTop: theme.spacing(4),
        paddingBottom: theme.spacing(4)
    },
    submitButton: {
        backgroundColor: 'white',
        borderRadius: '10px',
        margin: theme.spacing(1),
        width: '10ch'
    }
  }));

const SearchBar = (props) => {
    const classes = useStyles();
    return (
        <Container maxWidth = 'lg'>
            <form noValidate autoComplete="off">
                <Grid container spacing={1} className={classes.searchBar} container spacing ={3}>
                    <TextField onChange={(e)=>props.setTerm(e.currentTarget.value)}className={classes.form} id="outlined-basic" label="Search Term ..." variant="outlined" />
                    <FormGroup aria-label="position" row>
                        <FormControlLabel onChange={(e)=>console.log(e.currentTarget.value)}
                        value="name"
                        control={<Checkbox color="primary" />}
                        label="Name"
                        labelPlacement="bottom"
                        />
                        <FormControlLabel onChange={(e)=>console.log(e.currentTarget.value)}
                        value="type"
                        control={<Checkbox color="primary" />}
                        label="Type"
                        labelPlacement="bottom"
                        color='primary'
                        />
                        <FormControlLabel onChange={(e)=>console.log(e.currentTarget.value)}
                        value="text"
                        control={<Checkbox color="primary" />}
                        label="Text"
                        labelPlacement="bottom"
                        />
                    </FormGroup>
                    <Button onClick={props.filterCards} className={classes.submitButton} variant="outlined">Submit</Button>
                </Grid>
            </form>
        </Container>
    );
}

export default SearchBar;
